contracts/AgentRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title AgentRegistryV3
 * @notice Production registry for worker + verifier agents in CLAWGER
 *
 * - Permissionless registration
 * - Manager-only reputation updates
 * - Capability hashes stored as bytes32
 * - Emergency pause
 * - Safe manager rotation
 *
 * Discovery should happen off-chain via events.
 */
contract AgentRegistryV3 is Ownable, Pausable {
    uint256 public constant MAX_CAPABILITIES = 16;
    uint256 public constant BASE_REPUTATION = 50;

    enum AgentType {
        WORKER,
        VERIFIER
    }

    struct Agent {
        address wallet;
        AgentType agentType;

        bytes32[] capabilities;

        uint256 minFee;
        uint256 minBond;

        address operator;

        uint256 reputation;
        bool active;
        bool exists;

        uint256 registeredAt;
        uint256 updatedAt;
    }

    mapping(address => Agent) private agents;

    address public manager;
    address public pendingManager;

    event AgentRegistered(
        address indexed agent,
        AgentType indexed agentType,
        uint256 minFee,
        uint256 minBond,
        bytes32[] capabilities
    );

    event AgentUpdated(
        address indexed agent,
        uint256 minFee,
        uint256 minBond,
        bytes32[] capabilities,
        address operator
    );

    event AgentDeactivated(address indexed agent);
    event AgentReactivated(address indexed agent);

    event ReputationUpdated(
        address indexed agent,
        uint256 oldScore,
        uint256 newScore,
        string reason
    );

    event ManagerUpdateProposed(address indexed newManager);
    event ManagerUpdated(address indexed oldManager, address indexed newManager);

    modifier onlyManager() {
        require(msg.sender == manager, "Not authorized");
        _;
    }

    modifier onlyActiveAgent() {
        require(agents[msg.sender].active, "Agent not active");
        _;
    }

    constructor(address _manager) Ownable(msg.sender) {
        require(_manager != address(0), "Invalid manager");
        manager = _manager;
    }

    // =============================================================
    //                  MANAGER ROTATION
    // =============================================================

    function proposeManager(address newManager) external onlyOwner {
        require(newManager != address(0), "Invalid manager");
        pendingManager = newManager;
        emit ManagerUpdateProposed(newManager);
    }

    function acceptManagerRole() external {
        require(msg.sender == pendingManager, "Not pending manager");

        address old = manager;
        manager = pendingManager;
        pendingManager = address(0);

        emit ManagerUpdated(old, manager);
    }

    // =============================================================
    //                     REGISTRATION
    // =============================================================

    function registerAgent(
        AgentType agentType,
        bytes32[] calldata capabilities,
        uint256 minFee,
        uint256 minBond,
        address operator
    ) external whenNotPaused {
        require(capabilities.length > 0, "No capabilities");
        require(capabilities.length <= MAX_CAPABILITIES, "Too many capabilities");

        require(!agents[msg.sender].active, "Already active agent");

        bytes32[] memory cleanCaps = _dedupeCapabilities(capabilities);

        agents[msg.sender] = Agent({
            wallet: msg.sender,
            agentType: agentType,
            capabilities: cleanCaps,
            minFee: minFee,
            minBond: minBond,
            operator: operator,
            reputation: BASE_REPUTATION,
            active: true,
            exists: true,
            registeredAt: block.timestamp,
            updatedAt: block.timestamp
        });

        emit AgentRegistered(msg.sender, agentType, minFee, minBond, cleanCaps);
    }

    function updateAgent(
        uint256 newMinFee,
        uint256 newMinBond,
        bytes32[] calldata newCapabilities,
        address newOperator
    ) external onlyActiveAgent whenNotPaused {
        require(newCapabilities.length > 0, "No capabilities");
        require(newCapabilities.length <= MAX_CAPABILITIES, "Too many capabilities");

        bytes32[] memory cleanCaps = _dedupeCapabilities(newCapabilities);

        Agent storage agent = agents[msg.sender];

        agent.minFee = newMinFee;
        agent.minBond = newMinBond;
        agent.capabilities = cleanCaps;
        agent.operator = newOperator;
        agent.updatedAt = block.timestamp;

        emit AgentUpdated(msg.sender, newMinFee, newMinBond, cleanCaps, newOperator);
    }

    function deactivate() external onlyActiveAgent {
        agents[msg.sender].active = false;
        emit AgentDeactivated(msg.sender);
    }

    function reactivate() external whenNotPaused {
        require(agents[msg.sender].exists, "Not registered");
        require(!agents[msg.sender].active, "Already active");

        agents[msg.sender].active = true;
        agents[msg.sender].updatedAt = block.timestamp;

        emit AgentReactivated(msg.sender);
    }

    // =============================================================
    //                    REPUTATION CONTROL
    // =============================================================

    function updateReputation(
        address agentAddr,
        uint256 newScore,
        string calldata reason
    ) external onlyManager whenNotPaused {
        require(agents[agentAddr].exists, "Not registered");

        if (newScore > 100) newScore = 100;

        uint256 oldScore = agents[agentAddr].reputation;
        agents[agentAddr].reputation = newScore;

        emit ReputationUpdated(agentAddr, oldScore, newScore, reason);
    }

    // =============================================================
    //                        READ METHODS
    // =============================================================

    function getAgent(address agentAddr)
        external
        view
        returns (Agent memory)
    {
        require(agents[agentAddr].exists, "Agent not found");
        return agents[agentAddr];
    }

    function getCapabilities(address agentAddr)
        external
        view
        returns (bytes32[] memory)
    {
        require(agents[agentAddr].exists, "Not found");
        return agents[agentAddr].capabilities;
    }

    function isActive(address agentAddr) external view returns (bool) {
        return agents[agentAddr].active;
    }

    function hasCapability(
        address agentAddr,
        bytes32 capability
    ) external view returns (bool) {
        bytes32[] memory caps = agents[agentAddr].capabilities;
        for (uint256 i = 0; i < caps.length; i++) {
            if (caps[i] == capability) return true;
        }
        return false;
    }

    function getReputation(address agentAddr) external view returns (uint256) {
        require(agents[agentAddr].exists, "Not registered");
        return agents[agentAddr].reputation;
    }

    // =============================================================
    //                      EMERGENCY
    // =============================================================

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    // =============================================================
    //                    INTERNAL HELPERS
    // =============================================================

    function _dedupeCapabilities(
        bytes32[] calldata caps
    ) internal pure returns (bytes32[] memory result) {
        bytes32[] memory temp = new bytes32[](caps.length);
        uint256 count = 0;

        for (uint256 i = 0; i < caps.length; i++) {
            bool duplicate = false;
            for (uint256 j = 0; j < count; j++) {
                if (temp[j] == caps[i]) {
                    duplicate = true;
                    break;
                }
            }
            if (!duplicate) {
                temp[count] = caps[i];
                count++;
            }
        }

        result = new bytes32[](count);
        for (uint256 k = 0; k < count; k++) {
            result[k] = temp[k];
        }
    }
}

contracts/ClawgerManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IAgentRegistry {
    function updateReputation(address agent, uint256 newScore, string calldata reason) external;
    function getReputation(address agent) external view returns (uint256);
}

/**
 * @title ClawgerManagerV4
 * @notice Production-safe CLGR escrow + bond + slashing economy for CLAWGER
 *
 * ECONOMY:
 * - Proposal bond in CLGR
 * - Escrow in CLGR
 * - Worker bond in CLGR
 * - Slashing in CLGR
 *
 * SAFETY:
 * - No stuck escrow (expiry + refund)
 * - NonReentrant payouts
 * - One-time settlement
 * - CLAWGER override settlement authority
 * - Task expiry mechanism
 * - Address validation
 * - Pausable operations
 */
contract ClawgerManagerV4 is ReentrancyGuard, Pausable {
    using SafeERC20 for IERC20;

    // =============================================================
    //                        IMMUTABLES
    // =============================================================

    IERC20 public immutable CLGR;
    address public immutable clawger;
    IAgentRegistry public immutable registry;

    address public constant BURN_ADDRESS =
        0x000000000000000000000000000000000000dEaD;

    // =============================================================
    //                        CONSTANTS
    // =============================================================

    uint256 public constant PROPOSAL_BOND = 100 ether; // 100 CLGR
    uint256 public constant BOND_BURN_PERCENT = 50;
    uint256 public constant TASK_EXPIRY_DURATION = 7 days;
    uint256 public constant MAX_ESCROW = 1_000_000 ether; // 1M CLGR
    uint256 public constant MAX_OBJECTIVE_LENGTH = 1000;
    uint256 public constant MIN_WORKER_BOND = 1 ether; // 1 CLGR

    // =============================================================
    //                        ENUMS
    // =============================================================

    enum ProposalStatus {
        Pending,
        Accepted,
        Rejected,
        Expired
    }

    enum TaskStatus {
        Created,
        Bonded,
        InProgress,
        Completed,
        Verified,
        Failed
    }

    // =============================================================
    //                        STRUCTS
    // =============================================================

    struct Proposal {
        uint256 id;
        address proposer;
        string objective;

        uint256 escrow;
        uint256 deadline;

        ProposalStatus status;
        uint256 createdAt;
    }

    struct Task {
        uint256 id;
        uint256 proposalId;

        address worker;
        address verifier;

        uint256 escrow;
        uint256 workerBond;

        TaskStatus status;
        bool settled;

        uint256 createdAt;
        uint256 completedAt;
    }

    // =============================================================
    //                        STORAGE
    // =============================================================

    uint256 public proposalCounter;
    uint256 public taskCounter;

    mapping(uint256 => Proposal) public proposals;
    mapping(uint256 => Task) public tasks;

    mapping(uint256 => uint256) public lockedWorkerBond;

    // =============================================================
    //                        EVENTS
    // =============================================================

    event ProposalSubmitted(
        uint256 indexed proposalId,
        address indexed proposer,
        uint256 escrow,
        uint256 deadline
    );

    event ProposalAccepted(
        uint256 indexed proposalId,
        uint256 indexed taskId,
        address worker,
        address verifier
    );

    event ProposalRejected(
        uint256 indexed proposalId,
        string reason,
        uint256 burned,
        uint256 toClawger
    );

    event ProposalExpired(uint256 indexed proposalId);

    event WorkerBondPosted(
        uint256 indexed taskId,
        address indexed worker,
        uint256 amount
    );

    event TaskSettled(
        uint256 indexed taskId,
        bool success,
        uint256 payout
    );

    event TaskExpired(uint256 indexed taskId);

    // =============================================================
    //                        STATE
    // =============================================================

    address public owner;

    // =============================================================
    //                        MODIFIERS
    // =============================================================

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier onlyClawger() {
        require(msg.sender == clawger, "Only CLAWGER");
        _;
    }

    modifier onlyVerifierOrClawger(uint256 taskId) {
        Task storage t = tasks[taskId];
        require(
            msg.sender == t.verifier || msg.sender == clawger,
            "Not authorized"
        );
        _;
    }

    // =============================================================
    //                      CONSTRUCTOR
    // =============================================================

    constructor(address _clgr, address _registry, address _clawger) {
        require(_clgr != address(0), "Invalid CLGR");
        require(_registry != address(0), "Invalid registry");
        require(_clawger != address(0), "Invalid clawger");

        CLGR = IERC20(_clgr);
        registry = IAgentRegistry(_registry);
        clawger = _clawger;
        owner = msg.sender;
    }

    // =============================================================
    //                  PROPOSAL SUBMISSION
    // =============================================================

    /**
     * @notice Submit proposal with upfront escrow + bond
     * Deposits: escrow + PROPOSAL_BOND
     */
    function submitProposal(
        string calldata objective,
        uint256 escrowAmount,
        uint256 deadline
    ) external whenNotPaused returns (uint256) {
        require(bytes(objective).length > 0, "Empty objective");
        require(bytes(objective).length <= MAX_OBJECTIVE_LENGTH, "Objective too long");
        require(deadline > block.timestamp, "Bad deadline");
        require(escrowAmount > 0, "Escrow required");
        require(escrowAmount <= MAX_ESCROW, "Escrow too large");

        // Lock escrow + bond upfront
        CLGR.safeTransferFrom(
            msg.sender,
            address(this),
            escrowAmount + PROPOSAL_BOND
        );

        uint256 proposalId = ++proposalCounter;

        proposals[proposalId] = Proposal({
            id: proposalId,
            proposer: msg.sender,
            objective: objective,
            escrow: escrowAmount,
            deadline: deadline,
            status: ProposalStatus.Pending,
            createdAt: block.timestamp
        });

        emit ProposalSubmitted(proposalId, msg.sender, escrowAmount, deadline);

        return proposalId;
    }

    // =============================================================
    //                     ACCEPT / REJECT
    // =============================================================

    function acceptProposal(
        uint256 proposalId,
        address worker,
        address verifier,
        uint256 workerBond
    ) external onlyClawger whenNotPaused returns (uint256) {
        Proposal storage p = proposals[proposalId];

        require(p.status == ProposalStatus.Pending, "Not pending");
        require(block.timestamp < p.deadline, "Expired");
        require(worker != address(0), "Invalid worker");
        require(verifier != address(0), "Invalid verifier");
        require(workerBond >= MIN_WORKER_BOND, "Bond too small");

        p.status = ProposalStatus.Accepted;

        // Refund bond immediately
        CLGR.safeTransfer(p.proposer, PROPOSAL_BOND);

        uint256 taskId = ++taskCounter;

        tasks[taskId] = Task({
            id: taskId,
            proposalId: proposalId,
            worker: worker,
            verifier: verifier,
            escrow: p.escrow,
            workerBond: workerBond,
            status: TaskStatus.Created,
            settled: false,
            createdAt: block.timestamp,
            completedAt: 0
        });

        emit ProposalAccepted(proposalId, taskId, worker, verifier);

        return taskId;
    }

    function rejectProposal(
        uint256 proposalId,
        string calldata reason
    ) external onlyClawger {
        Proposal storage p = proposals[proposalId];
        require(p.status == ProposalStatus.Pending, "Not pending");

        p.status = ProposalStatus.Rejected;

        uint256 burnAmount = (PROPOSAL_BOND * BOND_BURN_PERCENT) / 100;
        uint256 toClawger = PROPOSAL_BOND - burnAmount;

        // Burn + treasury
        CLGR.safeTransfer(BURN_ADDRESS, burnAmount);
        CLGR.safeTransfer(clawger, toClawger);

        // Refund escrow
        CLGR.safeTransfer(p.proposer, p.escrow);

        emit ProposalRejected(proposalId, reason, burnAmount, toClawger);
    }

    function expireProposal(uint256 proposalId) external {
        Proposal storage p = proposals[proposalId];
        require(p.status == ProposalStatus.Pending, "Not pending");
        require(block.timestamp >= p.deadline, "Not expired");

        p.status = ProposalStatus.Expired;

        // Refund everything
        CLGR.safeTransfer(p.proposer, p.escrow + PROPOSAL_BOND);

        emit ProposalExpired(proposalId);
    }

    // =============================================================
    //                     TASK EXECUTION
    // =============================================================

    function postWorkerBond(uint256 taskId) external nonReentrant {
        Task storage t = tasks[taskId];

        require(t.status == TaskStatus.Created, "Not open");
        require(msg.sender == t.worker, "Not worker");

        CLGR.safeTransferFrom(msg.sender, address(this), t.workerBond);

        lockedWorkerBond[taskId] = t.workerBond;
        t.status = TaskStatus.Bonded;

        emit WorkerBondPosted(taskId, msg.sender, t.workerBond);
    }

    function startTask(uint256 taskId) external {
        Task storage t = tasks[taskId];

        require(t.status == TaskStatus.Bonded, "Not bonded");
        require(msg.sender == t.worker, "Not worker");

        t.status = TaskStatus.InProgress;
    }

    function submitWork(uint256 taskId) external {
        Task storage t = tasks[taskId];

        require(t.status == TaskStatus.InProgress, "Not running");
        require(msg.sender == t.worker, "Not worker");

        t.status = TaskStatus.Completed;
        t.completedAt = block.timestamp;
    }

    // =============================================================
    //                VERIFICATION + SETTLEMENT
    // =============================================================

    function verifyTask(
        uint256 taskId,
        bool success
    ) external nonReentrant onlyVerifierOrClawger(taskId) {
        Task storage t = tasks[taskId];

        require(t.status == TaskStatus.Completed, "Not completed");
        require(!t.settled, "Already settled");

        t.settled = true;

        uint256 bond = lockedWorkerBond[taskId];

        if (success) {
            t.status = TaskStatus.Verified;

            uint256 payout = t.escrow + bond;
            CLGR.safeTransfer(t.worker, payout);

            // Update reputation: +5
            uint256 currentRep = registry.getReputation(t.worker);
            uint256 newRep = currentRep + 5;
            if (newRep > 100) newRep = 100;
            registry.updateReputation(t.worker, newRep, "Task completed");

            emit TaskSettled(taskId, true, payout);

        } else {
            t.status = TaskStatus.Failed;

            // Slash bond → CLAWGER
            CLGR.safeTransfer(clawger, bond);

            // Refund escrow → proposer
            Proposal storage p = proposals[t.proposalId];
            CLGR.safeTransfer(p.proposer, t.escrow);

            // Update reputation: -15
            uint256 currentRep = registry.getReputation(t.worker);
            uint256 newRep = currentRep >= 15 ? currentRep - 15 : 0;
            registry.updateReputation(t.worker, newRep, "Task failed");

            emit TaskSettled(taskId, false, 0);
        }

        lockedWorkerBond[taskId] = 0;
        t.escrow = 0;
    }

    // =============================================================
    //                     TASK EXPIRY
    // =============================================================

    function expireTask(uint256 taskId) external nonReentrant {
        Task storage t = tasks[taskId];
        require(t.status == TaskStatus.Completed, "Not completed");
        require(!t.settled, "Already settled");
        require(block.timestamp >= t.completedAt + TASK_EXPIRY_DURATION, "Not expired");

        t.settled = true;
        t.status = TaskStatus.Failed;

        // Refund bond to worker (they did submit work)
        uint256 bond = lockedWorkerBond[taskId];
        CLGR.safeTransfer(t.worker, bond);

        // Refund escrow to proposer
        Proposal storage p = proposals[t.proposalId];
        CLGR.safeTransfer(p.proposer, t.escrow);

        lockedWorkerBond[taskId] = 0;
        t.escrow = 0;

        emit TaskExpired(taskId);
    }

    // =============================================================
    //                     EMERGENCY
    // =============================================================

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}

contracts/CLAWGERToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title CLAWGERToken
 * @dev ERC20 token for the CLAWGER autonomous labor marketplace
 * 
 * Features:
 * - Standard ERC20 functionality
 * - Minting capability for testing/rewards
 * - Ownable for admin controls
 */
contract CLAWGERToken is ERC20, Ownable {

    /**
     * @dev Constructor mints initial supply to deployer
     * @param initialSupply Initial token supply (in whole tokens, not wei)
     */
    constructor(uint256 initialSupply) 
        ERC20("CLAWGER", "CLAWGER") 
        Ownable(msg.sender) 
    {
        // Mint initial supply to deployer (convert to wei: initialSupply * 10^18)
        _mint(msg.sender, initialSupply * 10**decimals());
    }

    /**
     * @dev Mint new tokens (owner only)
     * @param to Recipient address
     * @param amount Amount to mint (in whole tokens)
     */
    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount * 10**decimals());
    }

    /**
     * @dev Burn tokens from caller's balance
     * @param amount Amount to burn (in whole tokens)
     */
    function burn(uint256 amount) public {
        _burn(msg.sender, amount * 10**decimals());
    }

    /**
     * @dev Get balance in whole tokens (for convenience)
     * @param account Address to check
     * @return Balance in whole tokens (not wei)
     */
    function balanceOfTokens(address account) public view returns (uint256) {
        return balanceOf(account) / 10**decimals();
    }
}

